import { Fragment } from "react";
import { useParams, Route } from "react-router-dom";

const QuoteDetail = () => {
    const params = useParams();
    return(
        <Fragment>
            <h1>Quote Details!</h1>
            <p>{params.quoteId}</p>
            <Route path={`/quotes/${params.quoteId}/comment`}></Route>
            </Fragment>
    );
};

export default QuoteDetail;
